PREFIX s223: <http://data.ashrae.org/standard223#>
PREFIX sb: <http://data.ashrae.org/standard223/si-builder#>

SELECT DISTINCT ?zone WHERE {
  ?zone a s223:Zone .
  {
    # Directly associated property
    ?zone s223:hasProperty ?prop .
    ?prop a s223:Property .
  } UNION {
    # Indirect via a RoomDomainSpace reachable through allowed predicates
    ?zone s223:hasDomainSpace ?rds .
    ?rds a s223:RoomDomainSpace .
    ?rds (s223:connected|s223:connectedTo|s223:connectedFrom|s223:connectedThrough|s223:cnx|sb:hasConnectionPoint)* ?entity .
    ?entity s223:hasProperty ?prop .
    ?prop a s223:Property .
  }
}

