ModelResponse(parts=[TextPart(content='Below is a **working, self‑contained SPARQL query** that returns **one row per zone‑property pair** for **all non‑writable properties** together with the **human‑readable labels** of the zone and the property, **and the two endpoint references** you asked for (ALC and MPC).  
I also explain why the original query returned only three columns (the endpoint bindings were often `UNBOUND`) and what was missing in the pattern that locates those references.

---

## 1. What was missing in the original query?

| Problem | Why it mattered | Fix |
|---------|----------------|-----|
| **Endpoint predicates were wrong** – the dataset does not use `brick:endpoint` or `brick:mpc_db_name` for the ALC / MPC references. | The OPTIONAL patterns never matched, so the columns `alcEndpoint` and `mpcEndpoint` were empty for almost every row. | Use the correct predicates defined by **Standard 223**: `std223:hasALCReference` and `std223:hasMPCReference`. |
| **`brick:writable` is not always present** – a property that has *no* `brick:writable` triple should still be considered *non‑writable*. The original `FILTER NOT EXISTS { ?prop brick:writable true }` was fine, but we can be explicit and also allow the case where the triple is missing. | The filter already works for “missing or false”, but adding an explicit `FILTER (!BOUND(?w) || ?w != true)` makes the intent crystal‑clear. | Keep the `FILTER NOT EXISTS` (or use the more verbose version shown below). |
| **Missing `rdfs:label` for the property itself** – the result set only shows three columns because the two endpoint columns never bound. | Users need the label of the property as part of the report. | Keep the optional label pattern unchanged. |
| **No ordering that groups by zone then property** – the original `ORDER BY ?zone ?propLabel` is fine, but we can also order on the zone label for a nicer human‑readable output. | Improves readability of the result set. | Add `ORDER BY ?zoneLabel ?propLabel`. |

---

## 2. The corrected query

```sparql
PREFIX rdfs:   <http://www.w3.org/2000/01/rdf-schema#>
PREFIX brick:  <https://brickschema.org/schema/Brick/>
PREFIX std223: <http://data.ashrae.org/standard223#>

SELECT
    ?zone          # the zone instance
    ?zoneLabel     # friendly name of the zone
    ?propLabel     # friendly name of the (non‑writable) property
    ?alcEndpoint   # ALC endpoint reference (if any)
    ?mpcEndpoint   # MPC endpoint reference (if any)
WHERE {
  # -----------------------------------------------------------------
  # 1️⃣  Zones (targets)
  # -----------------------------------------------------------------
  ?zone a std223:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }

  # -----------------------------------------------------------------
  # 2️⃣  Properties attached to the zone
  # -----------------------------------------------------------------
  ?zone std223:hasProperty ?prop .
  OPTIONAL { ?prop rdfs:label ?propLabel . }

  # -----------------------------------------------------------------
  # 3️⃣  Keep only non‑writable properties
  # -----------------------------------------------------------------
  #   * either there is no brick:writable triple, or it is false
  FILTER NOT EXISTS { ?prop brick:writable true }

  # -----------------------------------------------------------------
  # 4️⃣  Pull the ALC and MPC endpoint references (if they exist)
  # -----------------------------------------------------------------
