## 5. What to do if you still see empty `?mpc` or `?endpoint` columns  

* Verify the predicate names in your dataset.  Some deployments use `brick:hasMpcReference` instead of `brick:mpc_db_name`. Add another OPTIONAL clause for that predicate (as shown in the query).  
* Inspect a single property directly, e.g.:

  ```sparql
  SELECT ?p ?pred ?obj
  WHERE {
    <http://data.ashrae.org/standard223/data/lbnl-example-2#00174> std:hasProperty ?p .
    FILTER ( ?p = <http://data.ashrae.org/standard223/data/lbnl-example-2#bypass_damper_percentage_position> )
    ?p ?pred ?obj .
  }
  ```

  This will show you the exact predicates that store the MPC name and endpoint, which you can then plug into the main query.

